import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./AppNav.css";
import Router from "react-router-dom/Router";

class AppNav extends Component {
    constructor(props) {
        super(props);

        this.state = {

        }
    }

    render() {
        return (
            <Router>
                <nav>
                    <ul>
                        <li>
                            <Link to="/shop">
                                Shop
                        </Link>
                        </li>
                        <li>
                            <Link to="/login">
                                Login
                        </Link>
                        </li>
                        <li>
                            <Link to="/register">
                                Register
                        </Link>
                        </li>
                    </ul>
                </nav>
            </Router>
        );
    }
}

export default AppNav;
